import { Box, Center, Stack } from "@mantine/core";
import React from "react";

const ResponsivePhone = () => {
  return (
    <Stack>
      <Center>
        {/* <Box style={{ border: "1px solid #1b1c1b", borderRadius: "5px 5px 5px 5px" }}>Mobile</Box> */}
        <div
          style={{
            width: "200px",
            height: "400px",
            backgroundColor: "#000",
            borderRadius: "10px",
            position: "relative",
          }}
        >
          <div
            style={{
              backgroundColor: "#333",
              height: "60px",
              borderRadius: "10px 10px 0 0",
              position: "absolute",
              top: "0",
              left: "0",
              right: "0",
            }}
          ></div>
          <div
            style={{
              backgroundColor: "#333",
              height: "20px",
              width: "40px",
              margin: "0 auto",
              borderRadius: "10px",
              position: "absolute",
              top: "30px",
              left: "0",
              right: "0",
            }}
          ></div>
          <div
            style={{
              backgroundColor: "#fff",
              height: "300px",
              borderRadius: "0 0 10px 10px",
              position: "absolute",
              top: "60px",
              left: "0",
              right: "0",
              overflow: "hidden",
            }}
          >
            {/* Your content goes here */}
          </div>
        </div>
      </Center>
    </Stack>
  );
};

export default ResponsivePhone;
